from .base import Basefrom sqlalchemy import ForeignKeyfrom sqlalchemy.orm import mapped_column, Mapped, relationshipfrom sqlalchemy.dialects.postgresql import DATEfrom datetime import datefrom typing import Listclass Class(Base):    __tablename__ = 'Classes'    id: Mapped[int] = mapped_column('id', primary_key=True)    class_date: Mapped[date] = mapped_column('class_date', DATE)    one_class_id: Mapped[int] = mapped_column('one_class_id', ForeignKey('Schedule.id', ondelete='CASCADE'))    one_class: Mapped['Schedule'] = relationship('Schedule', back_populates='classes')    attendance: Mapped[List['Attendance']] = relationship('Attendance', back_populates='class_')    def __repr__(self):        return f"<Class(id='{self.id}', class_date='{self.class_date}', one_class_id='{self.class_date}')>"